const map3Images =
[
    "grassA", "shrubA", "treeA", "water", "hillA", "doorA", null, null, 
    null, null, null, null, null, "flower", "shrine", null
];

let sizeIndex = 4;

const createMap = (mapDiv, mapData, mapImages, mapNPCs) =>
{
    let mapData2D = [];

    for(let i = 0; i < 64; i++)
    {
        let arrayRow = [];
        for(let j = 0; j < 32; j++)
        {
            let thisDataByte  = mapData[i * 32 + j];
            arrayRow = [...arrayRow, (thisDataByte >> 4) & 0xF];
            arrayRow = [...arrayRow, thisDataByte & 0xF];
        }
        mapData2D = [...mapData2D, arrayRow];
    }

    for(let i = 0; i < 64; i++)
    {
        for(let j = 0; j < 64; j++)
        {
            let xText16 = j.toString(16).toUpperCase();
            if(xText16.length === 1)xText16 = "0" + xText16;
            let xText10 = j.toString().toUpperCase();
            if(xText10.length === 1)xText10 = "0" + xText10;

            let yText16 = i.toString(16).toUpperCase();
            if(yText16.length === 1)yText16 = "0" + yText16;
            let yText10 = i.toString().toUpperCase();
            if(yText10.length === 1)yText10 = "0" + yText10;

            let mapSpan = document.createElement("span");
            mapSpan.classList.add("map-span" + sizeIndex);
            mapSpan.title = "X=" + xText10 + "(0x" + xText16 + "), Y=" + yText10 + "(0x" + yText16 + ")";
            mapDiv.appendChild(mapSpan);

            if(mapImages[mapData2D[i][j]] !== null)
            {
                const img = document.createElement("img");

                if(mapImages[mapData2D[i][j]] === "water")
                {
                    img.src = "./images/water" + getWaterNumber(mapData2D, i, j) + ".gif";
                }
                else
                {
                    img.src = "./images/" + mapImages[mapData2D[i][j]] + ".png";
                }

                img.classList.add("map-img" + sizeIndex);
                mapSpan.appendChild(img);
            }

            //Load NPCs
            for(let k = 0; k < mapNPCs.length; k++)
            {
                let NPCIndex = mapNPCs[k][0] & 0x1F;
                if(i === mapNPCs[k][3] && j === mapNPCs[k][2])
                {
                    const img = document.createElement("img");
                    img.src = "./images/NPC" + NPCIndex + ".gif";
                    img.classList.add("map-img" + sizeIndex);
                    mapSpan.appendChild(img);
                    console.log(NPCIndex)
                }
            }
        }
        
        mapDiv.appendChild(document.createElement('br'));
    }
}

const getWaterNumber = (mapData2D, row, column) =>
{
    let num = 0;
    if((column - 1 >= 0) && (mapData2D[row][column-1] !== 3))num += 1; //Check left.
    if((row - 1 >= 0) && (mapData2D[row-1][column] !== 3))num += 2;    //Check up.
    if((column + 1 < 64) && (mapData2D[row][column+1] !== 3))num += 4; //Check right.
    if((row + 1 < 64) && (mapData2D[row+1][column] !== 3))num += 8;    //Check down.
    return num;
}

const zoomInBtn = document.getElementById("zoom-in");
const zoomOutBtn = document.getElementById("zoom-out");

zoomInBtn.addEventListener("click", () =>
{
    if(sizeIndex === 10)return;
    sizeIndex++;

    let mapSpanElement = document.querySelector(".map-span" + (sizeIndex-1));
    while(mapSpanElement !== null)
    {
        mapSpanElement.classList.remove("map-span" + (sizeIndex-1));
        mapSpanElement.classList.add("map-span" + sizeIndex);
        mapSpanElement = document.querySelector(".map-span" + (sizeIndex-1));
    }

    let mapImageElement = document.querySelector(".map-img" + (sizeIndex-1));
    while(mapImageElement !== null)
    {
        mapImageElement.classList.remove("map-img" + (sizeIndex-1));
        mapImageElement.classList.add("map-img" + sizeIndex);
        mapImageElement = document.querySelector(".map-img" + (sizeIndex-1));
    }
});

zoomOutBtn.addEventListener("click", () =>
{
    if(sizeIndex === 1)return;
    sizeIndex--;

    let mapSpanElement = document.querySelector(".map-span" + (sizeIndex+1));
    while(mapSpanElement !== null)
    {
        mapSpanElement.classList.remove("map-span" + (sizeIndex+1));
        mapSpanElement.classList.add("map-span" + sizeIndex);
        mapSpanElement = document.querySelector(".map-span" + (sizeIndex+1));
    }

    let mapImageElement = document.querySelector(".map-img" + (sizeIndex+1));
    while(mapImageElement !== null)
    {
        mapImageElement.classList.remove("map-img" + (sizeIndex+1));
        mapImageElement.classList.add("map-img" + sizeIndex);
        mapImageElement = document.querySelector(".map-img" + (sizeIndex+1));
    }
});

